import React from 'react';
import ProductList from '../Products/ProductList';

import { Products } from "../../data";

const Home = () => {
    return (
        <>  
        <div style={{textAlign: "center", alignItems: "space between"}}>
            <img src="/men.jpeg" style={{width: "700px"}} alt=""/>
            <img src="/women.jpeg" style={{width: "700px"}} alt=""/>
        </div>
        <div className="container">
            <ProductList items={Products}/>
        </div>
        </>
    )
}

export default Home;
